      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n\t\t\t\"@context\" : \"https:\/\/schema.org\",\n\t\t\t\"@type\" : \"VideoObject\",\n\t\t\t\"uploadDate\": \"2021-04-20T08:06:27Z\",\n\t\t\t\"name\" :\"Pável Pardo: 'Solari aplica en el América la exigencia que tuvo en River y el Real Madrid'\",\n\t\t\t\"description\":\"Pável Pardo se refirió al presente del América con Santiago Solari como entrenador y destacó el paso del Indiecito por River y Real Madrid como condicionante.\",\n\t\t\t\"duration\" : \"PT58S\",\n\t\t\t\"contentUrl\" : \"https:\/\/vms-players.minutemediaservices.com\/mplayer_embed.html?playerId=01e3s47trhyrfr54nx\u0026contentId=01f3q3tgtcrkvqvtg1b7\",\n\t\t\t\"thumbnailUrl\" : \"https:\/\/images2.minutemediacdn.com\/image\/upload\/video\/thumbnail\/mmsport\/01f3q3tgtcrkvqvtg1b7\/01f3q3tgtcrkvqvtg1b7-1ad620da2bc32662de717be8db65d6c1.jpg\",\n            \"transcript\" : \"Santiago Solari como jugador también estuvo en equipos grande. Salió de River. Un equipo que tiene la misma exigencia que el América. Cuando tú hablas de River, a diferencia de Boca, a diferencia de Racing, a diferencia de San Lorenzo, a diferencia de otros equipos. River tiene un sello, todos sus jugadores son muy técnicos, juegan bien al fútbol, a diferencia de Boca, que tienen calidad pero es más garra, más corazón, más lucha, todo eso... River siempre se ha caracterizado por jugadores con calidad y con técnica. El caso de Solari, un jugador técnicamente muy bueno, y eso lo llevó a jugar al Real Madrid. Está acostumbrado como jugador a esa exigencia\",\n\t\t\t\"url\": \"www.90min.com\/es\/posts\/pavel-pardo-solari-aplica-en-el-america-la-exigencia-que-tuvo-en-river-y-el-real-madrid-01f3q51y1t5a\"\n\t\t}\n\u003C\/script\u003E",
