      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n\t\t{\n\t\t\t\"@context\" : \"https:\/\/schema.org\",\n\t\t\t\"@type\" : \"VideoObject\",\n\t\t\t\"uploadDate\": \"2021-04-28T15:59:37Z\",\n\t\t\t\"name\" :\"Óscar Pareja: Los norteamericanos deben ser como su cultura\",\n\t\t\t\"description\":\"En entrevista para 90min, Óscar Pareja, entrenador de Orlando City, habló sobre las similitudes del fútbol estadounidense con el de otras latitudes\",\n\t\t\t\"duration\" : \"PT87S\",\n\t\t\t\"contentUrl\" : \"https:\/\/vms-videos.minutemediaservices.com\/01f4bw825hxqtn48t6px\/mp4\/01f4bw825hxqtn48t6px_270p.mp4\",\n\t\t\t\"thumbnailUrl\" : \"https:\/\/images2.minutemediacdn.com\/image\/upload\/video\/thumbnail\/mmsport\/01f4br8t2z2vraajb0v1\/01f4br8t2z2vraajb0v1-36082bd4103b98985ba1cbdd27e24679.jpg\",\n            \"transcript\" : \"-¿A qué fútbol se intenta asemejar la liga MLS?\n\t\t\t-Muy buena pregunta, porque tengo una respuesta que suena un poco fuerte\n\t\t\tpero se la transmito a los entrenadores americanos y se las transmito a mis grandes amigos entrenadores colombianos también.\n\t\t\tY como trabajo con argentinos, mis asistentes son argentinos, también la transmito por intermedio de ellos.\n\t\t\tYo pienso que los jugadores de Estados Unidos se tienen que parecer a los jugadores de Estados Unidos.\n\t\t\tY los jugadores colombianos se tienen que parecer a los jugadores colombianos.\n\t\t\tY pienso que, a pesar de la globalización que ha habido y de esa manera como se ampliaron las fronteras\n\t\t\tdonde podemos tener acceso a todas las metodologías, podemos tener acceso a todas las formas\n\t\t\tsobre todo a las que tienen el éxito temporal y podemos querer parecernos a esos equipos\n\t\t\ta ese entrenador, a esa liga, a esa identidad, a esa cultura...\n\t\t\tYo pienso que el respeto que debemos que tener por esa etnografía nuestra, esa propia identidad\n\t\t\tes la que hace que los países tengan éxito en sus procesos.\n\t\t\tLos jugadores americanos, Diego, se tienen que parecer a los jugadores americanos.\",\n\t\t\t\"url\": \"www.90min.com\/es\/posts\/oscar-pareja-los-jugadores-norteamericanos-deben-parecerse-a-su-cultura-01f4cka2rnyq\"\n\t\t}\n\u003C\/script\u003E",
